function PopupWithForm (props) {
  return(

    <div className={`popup ${props.name} ${props.isOpen && "popup_opened"}`}>
    <form
      class="popup__container popup__form"

      novalidate
    >



      <button
        class="popup__close-button hover"
        type="button"
        onClick={props.onClose}
      ></button>
      <h2 class="popup__container-title">{props.title}</h2>


      {props.children}

      <button class="popup__submit-button popup__button hover" type="submit">
        {props.button}
      </button>
    </form>
  </div>
  )
}

export default PopupWithForm
